<!DOCTYPE html>
<html>
<head>
	<title>Два инпута с кнопками и результатом рандома</title>
	<meta charset="utf-8">
	<style>
	body {
font-family: 'Roboto', sans-serif;
background-color: #F2F2F2;
}
		.limit{
		display: flex;
			flex-direction: row;
			align-items: center;
			justify-content: center;
		}
#first,
#end {
  padding: 10px;
  font-size: 1rem;
  border: none;
  border-radius: 4px;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.15);
  margin-bottom: 20px;
}input#first{margin-right:10px}
input#end{margin-left:10px}

button {width:43%;
  padding: 10px 10px;
  font-size: 1rem;
  background-color: #1E9696;
  color: #FFF;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.15);
}
button#random{margin-right:10px;background-color: #03c04a;}
button#reset{margin-left:10px;background-color: #b90e0a;}
button:hover {
  background-color: #1BA1A1;
  transition: background-color 0.3s ease;
}

label {
text-align:center;
  font-size: 1.2rem;
  color: #000;
  margin-right: 10px;
}

#result {
  font-size: 2rem;
  font-weight: bold;
  color: #000;
}
.forResult{margin-top: 10px;}

.container {
display: flex;
flex-direction: column;
max-width: 500px;
margin: 50px auto;
background-color: #FFFFFF;
border-radius: 5px;
padding: 20px;
box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.3);
}
.cong{margin-left:auto;margin-right:auto;}

	</style>
</head>

		<button id="random">Random</button>

		<label id="result"></label>

	</div>
